class Home extends Component
{
    render()
    {
        return(
            <div id = "home">
                <header className="masthead">
                    <div className="trolley"> </div>
                    <div className="container">
                        <div className="masthead-subheading">Looking For Something From China?</div>
                        <div className="masthead-heading text-uppercase">WE ARE A TRUSTED CHINA-AFRICA RUNNER</div>
                        <a className="btn btn-primary btn-xl text-uppercase" href="#services">Tell Me More</a>
                    </div>
                </header>
            </div>
        );
    }
}

export default Home
